import React from "react";

function About() {
  return (
    <section>
      <h2>Kişisel Bilgiler</h2>
      <p><strong>Ad:</strong> Furkan</p>
      <p><strong>Soyad:</strong> Örnek</p>
      <p><strong>İletişim:</strong> furkan@example.com</p>
    </section>
  );
}

export default About;
